import L from 'leaflet';

const iconPerson = L.Icon.extend({
  options: {
    iconUrl: require('./imgages/marker2.png'),
    iconRetinaUrl: require('./imgages/marker.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(60, 75),
    className: 'leaflet-div-icon'
  }
});

export { iconPerson };
